init_client3();
async function getSession(id) {
  return queryOne("SELECT * FROM sessions WHERE id = ?", [id]);
}
async function getSessionOrThrow(id) {
  const session = await getSession(id);
  if (!session)
    throw new NotFoundError("Session", id);
  return session;
}
async function createSession(input) {
  const id = uuid();
  const timestamp = now();
  const lastSession = await queryOne(`SELECT MAX(number) as number FROM sessions WHERE campaign_id = ?`, [input.campaignId]);
  const sessionNumber = (lastSession?.number || 0) + 1;
  await query(`INSERT INTO sessions (
      id, campaign_id, number, name,
      status, current_scene_id, current_location_id,
      scheduled_at, started_at, ended_at,
      total_duration, summary, notes,
      player_ids,
      created_at, updated_at, version
    ) VALUES (?, ?, ?, ?, 'scheduled', NULL, NULL, ?, NULL, NULL, 0, NULL, NULL, '[]', ?, ?, 1)`, [
    id,
    input.campaignId,
    sessionNumber,
    input.name || `Session ${sessionNumber}`,
    input.scheduledAt?.toISOString() || null,
    timestamp,
    timestamp
  ]);
  return getSessionOrThrow(id);
}
async function updateSession(id, updates) {
  const setClauses = ["updated_at = ?", "version = version + 1"];
  const params = [now()];
  if (updates.name !== undefined) {
    setClauses.push("name = ?");
    params.push(updates.name);
  }
  if (updates.status !== undefined) {
    setClauses.push("status = ?");
    params.push(updates.status);
  }
  if (updates.currentSceneId !== undefined) {
    setClauses.push("current_scene_id = ?");
    params.push(updates.currentSceneId);
  }
  if (updates.currentLocationId !== undefined) {
    setClauses.push("current_location_id = ?");
    params.push(updates.currentLocationId);
  }
  if (updates.summary !== undefined) {
    setClauses.push("summary = ?");
    params.push(updates.summary);
  }
  if (updates.notes !== undefined) {
    setClauses.push("notes = ?");
    params.push(updates.notes);
  }
  if (updates.playerIds !== undefined) {
    setClauses.push("player_ids = ?");
    params.push(toJson(updates.playerIds));
  }
  params.push(id);
  await query(`UPDATE sessions SET ${setClauses.join(", ")} WHERE id = ?`, params);
  return getSessionOrThrow(id);
}
async function startSession(id, playerIds) {
  await query(`UPDATE sessions SET
      status = 'active',
      started_at = ?,
      player_ids = ?,
      updated_at = ?,
      version = version + 1
     WHERE id = ?`, [now(), toJson(playerIds), now(), id]);
  await createEvent(id, {
    type: "session",
    subtype: "started",
    actorType: "system",
    data: { playerIds }
  });
  return getSessionOrThrow(id);
}
async function pauseSession(id) {
  const session = await getSessionOrThrow(id);
  let additionalDuration = 0;
  if (session.startedAt) {
    additionalDuration = Math.floor((Date.now() - new Date(session.startedAt).getTime()) / 1000);
  }
  await query(`UPDATE sessions SET
      status = 'paused',
      total_duration = total_duration + ?,
      updated_at = ?,
      version = version + 1
     WHERE id = ?`, [additionalDuration, now(), id]);
  await createEvent(id, {
    type: "session",
    subtype: "paused",
    actorType: "system",
    data: {}
  });
  return getSessionOrThrow(id);
}
async function resumeSession(id) {
  await query(`UPDATE sessions SET
      status = 'active',
      started_at = ?,
      updated_at = ?,
      version = version + 1
     WHERE id = ?`, [now(), now(), id]);
  await createEvent(id, {
    type: "session",
    subtype: "resumed",
    actorType: "system",
    data: {}
  });
  return getSessionOrThrow(id);
}
async function endSession(id, summary) {
  const session = await getSessionOrThrow(id);
  let additionalDuration = 0;
  if (session.startedAt && session.status === "active") {
    additionalDuration = Math.floor((Date.now() - new Date(session.startedAt).getTime()) / 1000);
  }
  await query(`UPDATE sessions SET
      status = 'ended',
      ended_at = ?,
      total_duration = total_duration + ?,
      summary = COALESCE(?, summary),
      updated_at = ?,
      version = version + 1
     WHERE id = ?`, [now(), additionalDuration, summary || null, now(), id]);
  await createEvent(id, {
    type: "session",
    subtype: "ended",
    actorType: "system",
    data: { totalDuration: session.totalDuration + additionalDuration }
  });
  return getSessionOrThrow(id);
}
