          switch (parsed.type) {
            case "token":
              fullText += parsed.content;
              options.onToken?.(parsed.content);
              break;
            case "emotion":
              options.onEmotion?.(parsed.content);
              break;
            case "action":
              options.onAction?.(parsed.content);
              break;
            case "complete":
              fullText = parsed.content;
              break;
            case "error":
              throw new Error(parsed.content || parsed.message);
          }
