var userRouter = router({
  me: protectedProcedure.query(async ({ ctx }) => {
    const user = await getUserByClerkId(ctx.auth.userId);
    return user;
  }),
  needsOnboarding: protectedProcedure.query(async ({ ctx }) => {
    return needsOnboarding(ctx.auth.userId);
  }),
  completeOnboarding: protectedProcedure.input(exports_external.object({
    displayName: exports_external.string().min(2).max(50),
    role: exports_external.enum(["player", "gm", "both"]),
    pronouns: exports_external.string().max(30).optional(),
    timezone: exports_external.string().optional()
  })).mutation(async ({ ctx, input }) => {
    const user = await updateUser(ctx.auth.userId, {
      displayName: input.displayName,
      preferredRole: input.role,
      pronouns: input.pronouns,
      timezone: input.timezone,
      onboardingComplete: true
    });
    return user;
  }),
  updateProfile: protectedProcedure.input(exports_external.object({
    displayName: exports_external.string().min(2).max(50).optional(),
    pronouns: exports_external.string().max(30).optional(),
    timezone: exports_external.string().optional(),
    preferredRole: exports_external.enum(["player", "gm", "both"]).optional()
  })).mutation(async ({ ctx, input }) => {
    const user = await updateUser(ctx.auth.userId, input);
    return user;
  })
});

